import React, { Component } from "react";
import Landing from "./Landing";
import Navigation from "./Navigation";
import "./Home.css";
import { Zoom } from "react-reveal";
import Particles from "react-particles-js";

export class Home extends Component {
  render() {
    return (
      <div>
        <div id="home" className="layout">
          <div id="navbar">
            <Navigation />
          </div>
          <div>
            <Particles
              params={{
                particles: {
                  number: {
                    value: 160,
                    density: {
                      enable: false
                    }
                  },
                  size: {
                    value: 3,
                    random: true,
                    anim: {
                      speed: 4,
                      size_min: 0.3
                    }
                  },
                  line_linked: {
                    enable: false
                  },
                  move: {
                    random: true,
                    speed: 1,
                    direction: "top",
                    out_mode: "out"
                  }
                },
                interactivity: {
                  events: {
                    onhover: {
                      enable: true,
                      mode: "bubble"
                    },
                    onclick: {
                      enable: true,
                      mode: "repulse"
                    }
                  },
                  modes: {
                    bubble: {
                      distance: 250,
                      duration: 2,
                      size: 0,
                      opacity: 0
                    },
                    repulse: {
                      distance: 400,
                      duration: 4
                    }
                  }
                }
              }}
            />
            <h1 className="brand-name">SHIVESH SHARMA</h1>
            <h3 className="work">
              <Zoom left cascade>
                <div style={{ display: "inline-block" }}>WEB </div>
              </Zoom>
              <Zoom right cascade>
                <div style={{ display: "inline-block" }}>DEVELOPER</div>
              </Zoom>
            </h3>
          </div>
        </div>
        <Landing />
      </div>
    );
  }
}

export default Home;
